// react
import React, { Component } from 'react';

// third-party
import PropTypes from 'prop-types';
import { Link } from 'react-router-dom';

// application
import Topbar from './Topbar';
import { LogoSvg } from '../../content/images/svg';
import { NavigationPanel } from './NavigationPanel';

export class Header extends Component {
    render() {
        return (
                <div className="ekat-header">
                    {/*
                     // Logo
                     */}
                    <div className="ekat-header__logo">
                        <Link to="/">
                            <LogoSvg />
                        </Link>
                    </div>

                    {/*
                     // Banner container 
                     */}
                    <div className="ekat-header__banner">
                    </div>

                    {/*
                     // Navigation panel
                     */}
                    <div className="ekat-header__nav-panel">
                        <NavigationPanel />
                    </div>

                    {/*
                     // User information
                     */}
                    <div className="ekat-header__user-info">
                    </div>

                    {/*
                     // Basket 
                     */}
                    <div className="ekat-header__basket">
                    </div>

                    {/*
                     // Language selector
                     */}
                    <div className="ekat-header__language">
                    </div>

                </div>
            );
    }
    
}
